import React from 'react';
import ProfilePost from './ProfilePost';
import { SimpleGrid } from '@mantine/core';

export default function ProfileFeed({posts, user}) {
    return(
        <>
        <SimpleGrid cols={2}>
            {posts.map((post) => {
            return <ProfilePost user={user }post={post} key={post._id} />
        })}
        </SimpleGrid>
        </>
    )
}
